const monthSelect = document.getElementById("monthSelect");
const yearSelect = document.getElementById("yearSelect");
const currentYear = new Date().getFullYear();
let currentMonth = new Date().getMonth() + 1;

const startYear = 2020;
const endYear = currentYear + 10;

// Populate months option with numbers 1 to 12
for (let month = 1; month <= 12; month++) {
  const option = document.createElement("option");
  option.value = `${month < 10 ? 0 : ""}${month}`;
  option.textContent = `${month < 10 ? 0 : ""}${month}`;
  monthSelect.appendChild(option);
}

// Populate years option with years from 2020 to 2030
for (let year = startYear; year <= endYear; year++) {
  const option = document.createElement("option");
  option.value = (year + "").slice(2, 4);
  option.textContent = year;
  yearSelect.appendChild(option);
}

//Input Error Handling
let isValid = false;
let cardNum = [[], [], [], []];

const numInput = document.querySelectorAll(".num-input");

[...numInput].map((el, i) => {
  el.addEventListener("input", function (e) {
    cardNum[i] = e.target.value;

    if (cardNum[0][0] == 2 || cardNum[0][0] == 5) {
      cardLogo.innerHTML = masterCard;
    } else if (cardNum[0][0] == 4) {
      cardLogo.innerHTML = visa;
    } else if (cardNum[0][0] == 3) {
      cardLogo.innerHTML = americanExpr;
    } else {
      cardLogo.innerHTML = defaultCard;
    }
  });
});

const cvvValue = document.getElementById("cvv");
const btn = document.querySelector(".form-submit");
const dateErr = document.querySelector(".card-date-err");
const cvvErr = document.querySelector(".card-cvv-err");
const nameErr = document.querySelector(".card-hold-err");
const cardNumErr = document.querySelector(".card-num-err");

btn.addEventListener("click", onFormSubmit);

// Utility function to compare DOM logo to Logo variable
function areHTMLStringsEqual(html1, html2) {
  const parser = new DOMParser();
  const doc1 = parser.parseFromString(html1, "text/html");
  const doc2 = parser.parseFromString(html2, "text/html");

  return doc1.isEqualNode(doc2);
}

function onFormSubmit(e) {
  const selectedMonth = monthSelect.value;
  const selectedYear = "20" + yearSelect.value;

  const cardNameIsValid = cardNameInput.value.trim().split(" ").length >= 2;
  const cvvIsValid = cvvValue.value.length >= 3 && cvvValue.value.length <= 4;
  const dateIsValid =
    selectedYear >= currentYear &&
    (selectedYear > currentYear || +currentMonth <= +selectedMonth);
  const cardNumIsValid =
    cardNum.join("").length == 16 &&
    !areHTMLStringsEqual(defaultCard, cardLogo.innerHTML);

  // Check if date is valid
  if (selectedMonth && selectedYear) {
    if (!dateIsValid) {
      dateErr.textContent = "Pick a future date";
      dateErr.style.display = "block";
    } else {
      dateErr.style.display = "none";
    }
  } else {
    dateErr.textContent = "Please select both month and year";
    dateErr.style.display = "block";
  }

  // Checks if Cardname is valid
  if (!cardNameIsValid) {
    nameErr.style.display = "block";
  } else {
    nameErr.style.display = "none";
  }

  // Checks if CVV entered is valid
  if (!cvvIsValid) {
    cvvErr.style.display = "block";
  } else {
    cvvErr.style.display = "none";
  }

  if (cardNameIsValid && dateIsValid && cvvIsValid && cardNumIsValid) {
    isValid = true;
  }
  // Checks if card length is 16
  if (!cardNumIsValid) {
    cardNumErr.style.display = "block";
  } else {
    cardNumErr.style.display = "none";
  }

  if (isValid) {
    cardNumErr.style.display = "none";
    cvvErr.style.display = "none";
    dateErr.style.display = "none";
  }

  !isValid && e.preventDefault();
  isValid && alert("Your payment was successful");
  // isValid
  //   ? setTimeout(function () {
  //       alert("Your payment was successful");
  //     }, 1000)
  //   : null;
}

const cardName = document.getElementById("card-name");
const cardDate = document.getElementById("card-date");
const cardNameInput = document.getElementById("card-hold-input");

// Update Card Holder Name in the card preview
cardNameInput.addEventListener("input", function (e) {
  cardName.textContent = e.target.value
    .replace(/[^a-zA-Z\s]/g, "")
    .replace(/\s+/g, " ");
});

// Update Card Expiry Date in the card preview
monthSelect.addEventListener("input", function (e) {
  let dateArr = [];
  dateArr.push(monthSelect.value);
  dateArr.push(yearSelect.value);
  cardDate.textContent = dateArr.join("/");
});

yearSelect.addEventListener("input", function (e) {
  let dateArr = [];

  dateArr.push(monthSelect.value);
  dateArr.push(yearSelect.value);
  cardDate.textContent = dateArr.join("/");
});
